column8:
　北海道の新鮮な鮭を独自の技術により、おいしさを損なう事なく仕上げました。魚骨の粉末を入れてあり、カルシウムが豊富です。また減塩タイプなのでとてもヘルシーです。魚の臭みも少ないので、魚嫌いの方からお子様でも美味しく召し上がれます。お茶漬け・おにぎり・サラダ・チャーハン・手巻き寿司などなど、工夫してお使いください！<br><br><table width="600" border="0"><tr style="width:580"><th width="587" style="background-color:#d2cac4; color:#fff; letter-spacing:1px; padding:10px">商品詳細</th></tr><tr><td><table width="600" border="0" cellpadding="7" cellspacing="1" bgcolor="#d2cac4" style="font-size:95%; line-height:130%; letter-spacing:110%"><tr bgcolor="#999999"><td width="100" height="25" bgcolor="#f4f0ec" align="center">商品番号</td><td width="568" bgcolor="#ffffff">mr3060</td></tr><tr bgcolor="#999999"><td width="100" height="25" bgcolor="#f4f0ec" align="center">原材料</td><td width="568" bgcolor="#ffffff">鮭、食用植物油脂、食塩、魚介エキス（原材料の一部に小麦、大豆（遺伝子組換えでない）を含む）、清酒、魚骨カルシウム、着色料（紅こうじ、パプリカ色素）</td></tr><tr bgcolor="#999999"><td width="100" height="25" bgcolor="#f4f0ec" align="center">内容量</td><td width="568" bgcolor="#ffffff">70g</td></tr><tr bgcolor="#999999"><td width="100" height="25" bgcolor="#f4f0ec" align="center">賞味期限</td><td width="568" bgcolor="#ffffff">製造日より1年</td></tr><tr bgcolor="#999999"><td width="100" height="25" bgcolor="#f4f0ec" align="center">広告文責</td><td width="568" bgcolor="#ffffff">有限会社自然館 0957-22-8770</td></tr><tr bgcolor="#999999"><td width="100" height="25" bgcolor="#f4f0ec" align="center">販売元</td><td width="568" bgcolor="#ffffff">株式会社純正食品マルシマ</td></tr></table></td></tr></table><style type=”text/css”>
